      (code === DOUBLE_QUOTE || code === SINGLE_QUOTE) &&
      (i === 0 || css.charCodeAt(i - 1) !== BACKSLASH)
    ) {
      if (inString === 0) {
        inString = code;
      } else if (inString === code) {
        inString = 0;
      }
      i++;
      continue;
    }

    // Skip string content
    if (inString !== 0) {
      i++;
