import generateAlphabeticName from './generateAlphabeticName';
import { hash } from './hash';

export default function generateComponentId(str: string) {
  return generateAlphabeticName(hash(str) >>> 0);
}
import { StyledTarget } from '../types';
import getComponentName from './getComponentName';
import isTag from './isTag';

export default function generateDisplayName(target: StyledTarget<any>) {
  return isTag(target) ? `styled.${target}` : `Styled(${getComponentName(target)})`;
}
import { StyledTarget } from '../types';

export default function isTag(target: StyledTarget<'web'>): target is string {
  return (
    typeof target === 'string' &&
    (process.env.NODE_ENV !== 'production'
      ? target.charAt(0) === target.charAt(0).toLowerCase()
      : true)
  );
}
